import React from 'react';

class Register extends React.Component {
  constructor(props){
    super(props)
    this.state= {
     email :"",
     name:"",
     password:""
    }
  }
  onEmailRegister=(event)=>{
      this.setState({email:event.target.value})
  }
  onPasswordRegister=(event)=>{
    this.setState({password:event.target.value})
  }
  onNameRegister=(event)=>{
    this.setState({name:event.target.value})
  }

  onSumbit=()=>{
    fetch('http://localhost:3000/signin',{
    method : 'put' ,
    headers : {'Content-Type': 'application/json'},
    body : JSON.stringify({
      email : this.state.email,
      password : this.state.password,
      name:this.state.name
    })
  }).then(response =>response.json())
  .then (data =>{
  if (data === 'succcess'){ this.props.onRouteChange('home')}
  })
  }
  render(){
    return (

      <article className="br3 shadow-5 ba  b--black-10 mv4 w-100 w-50-m w-25-l mw6 center">
      <main className="pa4 black-80">
         <div className="measure ">
          <fieldset id="sign_up" className="ba b--transparent ph0 mh0">
            <legend className="f2 fw6 ph0 mh0">Register</legend>
            <div className="mt3">
              <label className="db fw6 lh-copy f6" htmlFor="name">Name</label>
              <input onChange= {this.onNameRegister} className="pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="text" name="name"  id="name"/>
            </div>
            <div className="mt3">
              <label className="db fw6 lh-copy f6" htmlFor="email-address">Email</label>
              <input onChange= {this.onEmailRegister} className="pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="email" name="email-address"  id="email-address"/>
            </div>
            <div className="mv3">
              <label className="db fw6 lh-copy f6" htmlFor="password">Password</label>
              <input onChange= {this.onPasswordRegister} className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="password" name="password"  id="password"/>
            </div>
          </fieldset>
          <div className="">
            <input onClick ={this.onSumbit} className="b ph3 pv2 input-reset ba b--black bg-transparent grow pointer f6 dib" type="submit" value="Register"/>
          </div>

         </div>
         </main>
         </article>


    )
  }

}

export default Register
